// import { ReactComponent as LeftArrow } from '../../assets/images/left-arrow.svg';
import './homeStyles.scss'
const Carosel=()=> {
  const items = [
    { id: 1, imageUrl: require('../../assets/images/carousel-img1.jpg') },
    { id: 2, imageUrl: require('../../assets/images/carousel-img2.jpg') },
    { id: 3, imageUrl: require('../../assets/images/carousel-img3.jpg') },
    { id: 4, imageUrl: require('../../assets/images/carousel-img1.jpg') },
