    { id: 8, imageUrl: require('../../assets/images/carousel-img3.jpg') },
    { id: 9, imageUrl: require('../../assets/images/carousel-img1.jpg') },
    { id: 10, imageUrl: require('../../assets/images/carousel-img2.jpg') },
  ];

  const options = {
    items: 4,
    // loop: true,
    autoplayTimeout: 5000,
    dots: true,
    nav: true,
    margin: 20,
    navText: [
      `<span>
        <img src="${require('../../assets/images/LA-dis.png')}" class="leftArrowDis" alt="Right Arrow" />
        <img src="${require('../../assets/images/LA-en.png')}" class="leftArrowEnable" alt="Right Arrow" />
      </span>`,
      `<span>
        <img src="${require('../../assets/images/RA-dis.png')}" class="rightArrowDis" alt="Right Arrow" />
        <img src="${require('../../assets/images/RA-en.png')}" class="rightArrowEnable" alt="Right Arrow" />
      </span>`
    ],
    responsive: {
      0: {
          items: 1,
      },
