          items: 1,
      },
      700: {
          items: 2,
      },
      991: {
          items: 3,
      },
      1000: {
          items: 4,

      }
  },
  };
  const renderItems = () => {
    return items.map((item, index) => (
      <div key={item.id} className="item">
        <img src={item.imageUrl} alt={`Image ${item.id}`} />
        <div className="homeCarouselNameRole">
          <span className="homeCarouselName">Amar</span>
          <span className="homeCarouselRole">Student</span>
        </div>
      </div>
    ));
  };
